import axios from 'axios';

const api = axios.create({
  baseURL: 'https://api.github.com',
  auth: {
    username: 'procopio420',
    password: 'LemonHaze420!',
  }
});

export const my_api = axios.create({
  baseURL: 'http://localhost:8000',
})

export default api;
